import React from "react";
import './style.css';
import Card from "../Card";
import { getDefaultNormalizer } from "@testing-library/react";
import { NavLink } from "react-router-dom";

const SideBar = props => {
    return (
        <div className = "sidebarContainer">
            <Card>

                <div className = "cardHeader">
                    <span>Contents</span>
                </div>

                <div className = "cardContents">
                    <div className = "postTitle">
                        <a><h4>11 Essay Collections For When A Novel Feels Too Much</h4></a>
                        <div className = "date">6th July'2021</div>
                    </div>

                    <div className = "postTitle">
                        <a href = "#"><h4>40 LGBTQ+ Books To Read Now & Always</h4></a>
                        <div className = "date">6th June'2021</div>
                    </div>

                    <div className = "postTitle">
                        <a href = "#"><h4>Detransition, Baby Author Torrey Peters Procrastinates By Reading Moby Dick</h4></a>
                        <div className = "date">6th May'2021</div>
                    </div>

                    <div className = "postTitle">
                        <a href = "#"><h4>10 Tips For Hosting A Digital Book Club</h4></a>
                        <div className = "date">6th April'2021</div>
                    </div>
                </div>
                
            </Card>
        </div>
    )
};

export default SideBar;
